import { useEffect } from 'react';
import { useDispatch, useSelector } from 'react-redux';

const Womens = () => {
  const dispatch = useDispatch();
  useEffect(() => {
    dispatch(FetchWomensProducts());
  }, []);
  const data = useSelector((state) => state.women.wdata);
  console.log(data);
};

export default Womens;
